AvgDiscountbyRep.query:
q = load "${App.Datasets.Quote_Line_Item.FullyQualifiedName}";
q = group q by 'Owner_UniqueUserName';
q = foreach q generate 'Owner_UniqueUserName' as 'Owner_UniqueUserName', first('Owner_SmallPhotoUrl') as 'ChatterImage', avg('SBQQ_Discount__c') as 'avg_SBQQ_Discount__c';
q = order q by 'avg_SBQQ_Discount__c' desc;
q = limit q 2000;

AvgStatus_By_Owner.query:
q = load "${App.Datasets.Quote_History.FullyQualifiedName}";
q = group q by 'Owner_Name';
q = foreach q generate 'Owner_Name' as 'Owner_Name', avg('TimePerStatus') as 'avg_TimePerStatus', first('Owner_SmallPhotoUrl') as 'ChatterImage';
q = order q by 'avg_TimePerStatus' desc;
q = limit q 2000;

ApprovalTime_By_Approver.query:
q = load "${App.Datasets.Quote_Approval.FullyQualifiedName}";
q = filter q by 'StepStatus' in ["Approved", "Rejected"];
q = filter q by 'Process_TableEnumOrId' in ["SBQQ_Quote__c"];
q = group q by 'Approver_UniqueUserName';
q = foreach q generate 'Approver_UniqueUserName' as 'Approver_UniqueUserName', avg('Approval_ElapsedTimeInMinutes') as 'avg_Approval_ElapsedTimeInMinutes', first('Approver_SmallPhotoUrl') as 'ChatterImage';
q = order q by 'avg_Approval_ElapsedTimeInMinutes' desc;
q = limit q 2000;

Quote_To_Close_By_Owner.query:
q = load "${App.Datasets.Quote_Line_Item.FullyQualifiedName}";
q_B = filter q by 'Opportunity_IsWon' == "true";
result = group q by 'Owner_Name' full, q_B by 'Owner_Name';
result = foreach result generate coalesce(q.'Owner_Name', q_B.'Owner_Name') as 'Owner_Name', unique(q.'Quote_Id') as 'A', unique(q_B.'Opportunity_Id') as 'B', first(q.'Owner_SmallPhotoUrl') as 'ChatterImage';
result = foreach result generate 'Owner_Name', 'A', 'B', coalesce(A/B,0) as 'Quote to Close', 'ChatterImage' as 'ChatterImage';
result = order result by ('Quote to Close' desc);
result = limit result 2000;
